import React from 'react'
import VideoPlayer from './VideoPlayer';
import ButtonPlayer from './ButtonPlayer';

const videoMainStyle = {
    height: "100vh",
    display: "flex",
    justifyContent: "space-around",
}


export default function VideoMain() {
  return (
    <div style={videoMainStyle}>
      <VideoPlayer />
    </div>
  );
}
